import React from 'react'
import { MovieState } from "../Context/MovieContext";
import HeroNav from '../components/Hero/HeroNav';
import '../App.css';

const Movies = () => {
  return (
    <MovieState>
    <div className="aboutBody">
    <HeroNav />
    <div>
        <h1>testing</h1>
    </div>
    </div>
  </MovieState>
  );
};

export default Movies;
